import React from 'react';
// import './EventDetail.css';

const EventDetail = ({ event }) => {
  return (
    <div className="event-detail">
      <h2>{event.name}</h2>
      <p>Date: {event.date}</p>
      <p>Location: {event.location}</p>
      {/* Additional event details */}
    </div>
  );
};

export default EventDetail;
